import React, {Component} from "react";
import { Link, animateScroll as scroll } from "react-scroll";
import {Container, Navbar, Nav} from "react-bootstrap";
import {translate} from "react-switch-lang"
import logo from "./logoKancelar.png"
import "./Header.css"
import "bootstrap/dist/css/bootstrap.min.css";
import {NavLink} from "react-router-dom";

class Headers extends Component {
    scrollToTop = () => {
        scroll.scrollToTop();
    };

    render() {
    const {t} = this.props;
           return (
            <div>
                <Navbar sticky="top" collapseOnSelect expand="md" className="navbar-expand-lg fixed-top scrolling-navbar navbar-dark bg-dark" >
                <Container>
                <Navbar.Brand href="#home"><img width="40" height="39"
                                                src={logo}
                                                alt="Logo"
                                                onClick={this.scrollToTop}
                /></Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                    <Nav className="nav mr-auto">
                        <Link
                                activeClass="active"
                                to="section1"
                                spy={true}
                                href="#section1"
                                smooth={true}
                                offset={-70}
                                duration={800}
                            >{t('header.section1.title')}</Link>

                    </Nav>
                </Navbar.Collapse>
                </Container>
            </Navbar>
            </div>

           )
    }
}


export default translate(Headers);

